import React from "react";
import "./homepage.css";
import { ReactComponent as HelloIcon } from "../icons/cancel.svg";

export default function Homepage() {
  return (
    <div>
      <div class="container">
        <h1>
          Hello I'm Ankur.
          <br /> I'm full a stack developer.
        </h1>
        <div class="curtain"></div>
        <div class="image-container">
          <HelloIcon />
        </div>
      </div>
    </div>
  );
}
